import { defineStore } from 'pinia';
import axios from 'axios';

export const useTaskStore = defineStore('taskStore', {
  state: () => ({
    tasks: [],
  }),
  actions: {
    getTask() {
      axios
        .get(`/api/tasks`)
        .then((response) => {
          response.data;
        })
        .catch((error) => {
          console.log(error);
        });
    },
  },
});
